import React from "react"
import { NavLink } from "react-router-dom"

export const Menu: React.FC = React.memo((): JSX.Element => {
    return(
        <div>
            <ul>
                <li><NavLink to={'/'}>Task</NavLink></li>
                <li><NavLink to={'/add-task'}>Add-task</NavLink></li>
            </ul>
        </div>
    )
})
